import { type } from "@testing-library/user-event/dist/type";
import React, {useState} from "react";
import { useParams } from 'react-router-dom'

type UserType = {
    id : String,
    name : String,
    stargazers : String
};

type UsersType = Array<UserType>

function RepoList (){
    let username = useParams()
    let Status = 0;
    let Message = "";
    let url = "https://api.github.com/users/"+username.username+"/repos"
    const [user, setUsers] = React.useState<UsersType>([])

    React.useEffect(() => {
        console.log(url)
        fetch(url, { method: "GET" })
        .then(response => {
            console.log(response.json())
            return response.json()
        })
        .then( json => setUsers(json))
        .catch((error) => {
            Message = "Something Wrong";
        });
    })

    return (
        <div>
            <h1>
                Repository for { username.username }
            </h1>
            <div>
                {
                    user && user.map((user) =>{
                        <div>
                            <p>Name : {user.name}</p>
                        </div>
                    })
                }
            </div>
        </div>


    );
}


export default RepoList;
